import React, { Component } from "react";
import { Navbar, Nav } from "react-bootstrap";

const Navigation = props => {
  return (
    <Navbar bg="primary">
      <Navbar.brand>Job Safari</Navbar.brand>
      <Nav className="navbar" />
    </Navbar>
  );
};

export default Navigation;
